import "./index.css";
import logo from "./images/logo.svg";
import { useState } from "react";

export default function App() {
  return (
    <div className="container">
      <div className="logo">
        <img src={logo} alt="logo" />
      </div>
      <div className="card">
        <Bill />
        <Result />
      </div>
    </div>
  );
}

function Bill() {
  const [bill, setBill] = useState(0);
  const [numPeople, setNumPeople] = useState(0);
  const [custom, setCustom] = useState(null);

  const first = 5;
  const sec = 10;
  const third = 15;
  const fourth = 25;
  const fifth = 50;

  return (
    <div className="bill">
      <div className="bill-info separator">
        <label>Bill</label>
        <input
          type="text"
          value={bill}
          onChange={(e) => setBill(Number(e.target.value))}
        />
      </div>
      <div className="tip-info separator">
        <label>Select Tip %</label>
        <div className="inputs">
          <input type="text" value={first} readOnly />
          <input type="text" value={sec} readOnly />
          <input type="text" value={third} readOnly />
          <input type="text" value={fourth} readOnly />
          <input type="text" value={fifth} readOnly />
          <input
            className="special"
            type="text"
            placeholder="Custom"
            value={custom}
            onChange={(e) => setCustom(Number(e.target.value))}
          />
        </div>
      </div>
      <div className="people-info separator">
        <span className="number">
          <label>Number of Peaple</label>
          <span
            className="message"
            style={numPeople === 0 ? { display: "block" } : {}}
          >
            Can't be zero
          </span>
        </span>
        <input
          style={numPeople === 0 ? { outline: "2px solid #ff0000d9" } : {}}
          type="text"
          value={numPeople}
          onChange={(e) => setNumPeople(Number(e.target.value))}
        />
      </div>
    </div>
  );
}

function Result() {
  return (
    <div className="result">
      <div className="separator tip-result">
        <div className="parent">
          <label>Tip Amount</label>
          <span>/ person</span>
        </div>
        <input type="text" value="$0.00" readOnly />
      </div>

      <div className="total-result">
        <div className="parent">
          <label> Total</label>
          <span>/ person</span>
        </div>
        <input type="text" value="$0.00" readOnly />
      </div>

      <button>Reset</button>
    </div>
  );
}
